import React, {Component} from "react";

class Result extends Component {

    constructor () {
        super();
    }

    render() {
        return (
            <div>
                {
                this.prop.searchresult?

                <p>{this.prop.searchresult}</p>

                :
                <p></p>
              }
            </div>
        );
    }


}

export default Result;
